pragma solidity ^0.4.26;

contract Viewable {

    string private WebComponent;

    constructor () internal {
        WebComponent = "empty";
    }

    function compareStrings (string memory a, string memory b) internal pure returns (bool) { 
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))) );
    }    

    function isViewable() public view returns (bool) {

        if(compareStrings(WebComponent, "empty")){
            return false;
        }

        return true;
    }

    function setWebComponent(string memory WebCMP) public {
        WebComponent = WebCMP;
    }

    function getWebComponent() public view returns (string memory){
        return WebComponent;
    }


}
